(15, 31, 'Greetings from Artwaley', '<table align="center" border="0" cellpadding="1" cellspacing="1" style="background:#eeeeee; width:100%">\n	<tbody>\n		<tr>\n			<td>\n			<table align="center" border="0" cellpadding="1" cellspacing="1" style="background:#ffffff; width:500px">\n				<tbody>\n					<tr>\n						<td style="text-align:center"><a href="www.artwaley.com" target="_blank"><img alt="" src="https://gallery.mailchimp.com/5cbfd955b4e1a4f1dd910eda6/images/6c0b5615-af29-41ec-9a89-d7c9fe746cd0.png" style="height:96px; width:293px" /></a>\n						<hr />\n						<table align="center" border="0" cellpadding="1" cellspacing="1" style="background:#ffffff; width:460px">\n							<tbody>\n								<tr>\n									<td colspan="3" style="text-align:left">\n									<p><span style="color:#f39c12"><span style="font-size:16px"><strong>Jai Jeenendra ,</strong></span></span><br />\n									<span style="color:#2c3e50">I am Priyal Gautam Ostwal, It was great meeting you at JITO Goa Summit<br />\n									I would like to brief about our Company: ARTWALEY (One-Stop Shop for Painting, Sculptures, Murals, and Wall Art).</span><br />\n									<br />\n									<span style="color:#e67e22"><strong>Offerings:</strong></span><br />\n									<span style="color:#2c3e50">&nbsp; &nbsp; &nbsp; &nbsp;1. Paintings, Sculptures, Murals, Wall Art.<br />\n									&nbsp; &nbsp; &nbsp; &nbsp;2. Vastu, Religious And Custom Based Paintings.<br />\n									&nbsp; &nbsp; &nbsp; &nbsp;3. Corporate Bulk Orders For Gifting.<br />\n									&nbsp; &nbsp; &nbsp; &nbsp;4. Beautification Of Corporate Spaces, Schools, Colleges, Hotels And&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Hospitals.<br />\n									&nbsp; &nbsp; &nbsp; &nbsp;5.Turnkey Art Projects. </span><br />\n									<br />\n									<strong><span style="color:#e67e22">Competitive Advantages:</span></strong><br />\n									<span style="color:#2c3e50">&nbsp; &nbsp; &nbsp; &nbsp; &bull; 2500 Plus Diversified Artworks.<br />\n									&nbsp; &nbsp; &nbsp; &nbsp; &bull; 125+ Artists associated.<br />\n									&nbsp; &nbsp; &nbsp; &nbsp; &bull;&nbsp;Customized artworks according to the requirements / theme </span><br />\n									<br />\n									<span style="color:#000000">Please find attached Our company profile for your kind reference. Any Art requirement for your Office , House , Schools , Collages , Projects , etc please do connect us.</span><br />\n									Eager to explore the synergies of working together.<br />\n									&nbsp;</p>\n\n									<p><a href="https://drive.google.com/open?id=1UpWgw8oks-99iB4Rr9yrFTZOoceA0orY" style="color: rgb(8, 82, 148); font-weight: bold;" target="_blank"><span style="color:#f39c12">Artwaley Company Profile</span></a><span style="color:#f39c12">.</span><br />\n									<a href="https://drive.google.com/open?id=1B1VEWfF5QG5euscfLxuCGSGACgbVMlxJ" style="color: rgb(0, 49, 99); font-weight: bold;" target="_blank"><span style="color:#f39c12">Artwaley Sculpture&nbsp; portfolio.</span></a><br />\n									<a href="https://drive.google.com/open?id=1rYFy9S-kqAUE6-s5Wl-Ar44ppdXGFSud" style="color: rgb(8, 82, 148); font-weight: bold;" target="_blank"><span style="color:#f39c12">Artwaley Project Profile.</span></a></p>\n									</td>\n								</tr>\n								<tr>\n									<td colspan="3">\n									<hr />\n									<p><span style="font-size:14px"><span style="color:#999999"><strong><u>Thank You</u></strong></span></span></p>\n									</td>\n								</tr>\n								<tr>\n									<td>&nbsp;</td>\n									<td>&nbsp;</td>\n									<td>&nbsp;</td>\n								</tr>\n							</tbody>\n						</table>\n						</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>\n', 'Aug 01 2018 11:56 am'),
